description:
PLOT: Alex and her friends go to the woods for a couple of days. Her friends are killed by the wild, now staple mutant killer, Three Finger, who of course cannibalizes them. She is left to fend for herself, but not for long. Meanwhile some dangerous prisoners are being transferred by Nate Wilson, a prison warden, on his last day before leaving to become a lawyer. During transport their truck is attacked by Three Finger and the prisoners escape. While being chased through the woods, the prisoners come across an abandoned truck filled with bags of money. One-by-one Three Finger kills all the prisoners and everyone who searches for them.
